import React, { Component } from "react";
import { Text, StyleSheet, View, ScrollView } from "react-native";
import H1 from "../../Texts/H1";
import InputField from "../../inputFields/InputField";
import Button from "@material-ui/core/Button";
import Menu from "@material-ui/core/Menu";
import MenuItem from "@material-ui/core/MenuItem";
import ReusableBtn from "../../buttons/ReusableBtn";

export default function SignUp() {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handlePress = event => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <ScrollView>
      <H1 h1Text="Delivery Information" />
      <Button
        aria-controls="simple-menu"
        aria-haspopup="true"
        onPress={handlePress}
      >
        Country
      </Button>
      <Menu
        id="simple-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}
      >
        <MenuItem onPress={handleClose}>Canada</MenuItem>
        <MenuItem onPress={handleClose}>USA</MenuItem>
        <MenuItem onPress={handleClose}>UK</MenuItem>
      </Menu>
      <InputField fieldLabel="Address" fieldName="address" />
      <InputField fieldLabel="Postcode" fieldName="postcode" />
      <InputField fieldLabel="Delivery Instruction" fieldName="" />

      <ReusableBtn btnText="Done" />
    </ScrollView>
  );
}

const styles = StyleSheet.create({});
